    border: 1px solid #ddd;
    border-radius: 10px;
    padding: 40px 20px;
    height: 60px;
    display: flex;
    justify-content: space-between;
    align-items: center;
`
const HomeMenuTitle = styled.h3`
    font-size: 24px;
    font-weight: 400;
`


export default TodosList
